const Form = () => {

    return (
        <div className='form' style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
            <input type='text' placeholder='name' />
            <textarea rows='2' placeholder='bio'></textarea>
            <input type='text' placeholder='ies' />
            <button></button>
        </div>
    )
}

export default Form;
